import React from "react";
import CardBody from "../CardBody";
import CardBtn from "../CardBtn";
import CardImg from "../CardImage";
import CardHeading from "../CardHeading";
import "./style.css";

function Card({ image, lastname, firstname, email, language }) {
  return (
    <div>
      <CardHeading lastname={lastname} firstname={firstname}/>
      <CardImg image={image}/>
      <CardBody email={email} language={language}/>
      <CardBtn style={{ opacity: image ? 1 : 0 }} />
      <CardBtn style={{ opacity: image ? 1 : 0 }} />
    </div>
  );
}

export default Card;
